using System;\nusing System.Linq;\nusing System.Text.RegularExpressions;\nusing FileHelpers;\n\nclass Program\n{\n    static void Main(string[] args)\n    {\n        var engine = new FileHelperEngine<HttpLogEntry>();\n\n        string logEntry = "xxx.xxx.xxx.xxx - - [14/Jun/2008:18:04:17 +0000] \"GET http://www.some_url.com HTTP/1.1\" 200 73662339 \"-\" \"iTunes/7.6.2 (Macintosh; N; Intel)\"";\n\n        var regex = new Regex(@"(?<IP>\S+) - - \[(?<Timestamp>[^\]]+)\] ""(?<Request>[^""]+)"" (?<StatusCode>\d+) (?<Bytes>\d+) ""(?<Referrer>[^""]*)"" ""(?<UserAgent>[^""]+)""");\n\n        var match = regex.Match(logEntry);\n\n        if (match.Success)\n        {\n            var entry = new HttpLogEntry\n            {\n                IPAddress = match.Groups["IP"].Value,\n                Timestamp = match.Groups["Timestamp"].Value,\n                Request = match.Groups["Request"].Value,\n                StatusCode = int.Parse(match.Groups["StatusCode"].Value),\n                BytesTransferred = long.Parse(match.Groups["Bytes"].Value),\n                Referrer = match.Groups["Referrer"].Value,\n                UserAgent = match.Groups["UserAgent"].Value\n            };\n\n            // Process the entry as needed\n            Console.WriteLine($"IP: {entry.IPAddress}");\n            Console.WriteLine($"Timestamp: {entry.Timestamp}");\n            Console.WriteLine($"Request: {entry.Request}");\n            Console.WriteLine($"Status Code: {entry.StatusCode}");\n            Console.WriteLine($"Bytes Transferred: {entry.BytesTransferred}");\n            Console.WriteLine($"Referrer: {entry.Referrer}");\n            Console.WriteLine($"User Agent: {entry.UserAgent}");\n        }\n    }\n}